ax.plot(x_positions, means, color='red', marker='o', linestyle='--', label='Mean Trend')

# Ticks and labels
ax.set_xticks(x_positions)
ax.set_xticklabels([str(x) for x in x_vals])
ax.set_xlabel("Model Size (2^x)")
ax.set_ylabel("Accuracy")
ax.grid(axis='y', linestyle='--', alpha=0.7)

plt.tight_layout()
plt.savefig("acc_model_size.png", dpi=300)